            "text": "CLEVELAND, Ohio - NBA 2K18's ratings might be the most overanalyzed thing in video gaming today. But 2K Sports seems to be getting things right. Dwayne Wade revealed both his and LeBron James' ratings for this year's game. Wade has an 84, while James has a 97. That latter's rating puts James at the top of this year's list of players revealed so far. It beats Kevin Durant's rating of a 96 (the previous high for this year's game). Two important ratings have yet to be revealed: James Harden and Rus.. Advertisement",
