            "text": "White House names Hicks interim communications director Wednesday, August 16, 2017 11:26 a.m. EDT Hope Hicks, communication director for U.S. Republican presidential candidate Donald Trump is pictured following a news conference at Trump WASHINGTON (Reuters) - Longtime Trump communications aide Hope Hicks has been named as interim communications director, the White House said on Wednesday, in the latest personnel move for President Donald Trump as he continues to seek someone for the job. The role of communications director had last been filled by Anthony Scaramucci, a New York financier who was ousted after just 10 days following an obscene tirade he made to a reporter for The New Yorker magazine. Scaramucci proved to be a divisive figure in the White House. Former press secretary Sean Spicer resigned over his arrival, and Chief of Staff John Kelly, once he took over, fired Scaramucci. Hicks, 28, worked in communications for Trump during",
