            "host": "wibqam.com",
            "text": "Television gets its own festival in New York's Tribeca Wednesday, August 16, 2017 11:07 a.m. EDT Actor Robert De Niro arrives to receive his Chaplin Award from the Film Society of Lincoln Center in the Manhattan borough of New York, U.S. LOS ANGELES (Reuters) - The organizers of New York's annual Tribeca Film Festival are launching a standalone television event to recognize the vast and varied content now available on broadcast, cable and streaming platforms. Organizers said on Wednesday the inaugural three-day Tribeca TV Festival will take place on Sept. 22-24 in New York, and is aimed at bringing new shows and returning favorites to the public. The lineup for the festival includes screenings and celebrity talks for the return of comedy \"Will & Grace,\" the upcoming season premieres of dramas \"Queen Sugar,\" \"Designated Survivor\" and \"Gotham,\" and the world premiere of \"Look But With Love,\" a virtual reality series",
