            "url": "http://www.fftimes.com/obituaries/lori-ann-mclean",
            "host": "fftimes.com",
            "text": "LORI ANN McLEAN Wednesday, Aug 16, 2017 Lori Ann McLean passed away peacefully, surrounded with love, on Friday, Aug. 11, 2017 at La Verendrye Hospital in Fort Frances, Ont. She was born on May 7, 1966 in Edmonton, Alta. Lori was an amazing woman who fought the good fight throughout her life. She was a warrior in her battle with cancer and had a ferocious will to live. Lori will be remembered for her infectious laugh, her big blue eyes, her kindness, her generosity, and her honesty. Everyone who met Lori was touched by her in a special way. She had an uncanny ability to always make those around her feel good. Her love of dogs came early in her life, and she cared for and loved her four fur babies, Solitaire, Buddy, Champ, and Turbo. The Toronto Blue Jays were a close second to her “pooches.” She loved watching",
